import { useParams } from "react-router-dom"
import Header from "./Header";


const ProviderDetail = () => {

    const { name } = useParams();

    return(
        <>
            <Header></Header>

            <section> </section>
            <h1>{name}</h1>
        </>
    )
}

export default ProviderDetail
